import React from "react";
import {NavLink} from "react-router-dom";

const Home = () => {
    return (
        <div>
            <span>
                Home
            </span>
            <NavLink to="/teachers/Biology/Tommy">Tommy Biology</NavLink>
        </div>
    );
};

export default Home;
